it.<br>The sum of all my 4 digits is 19.<br>What number am I ? ','ms','2023-05-25 00:00:00','','NANHUA 2012 CA1.3',NULL),(121,'MA_P5','Draw a line of symmetry in the figure below','ms','2023-05-29 00:00:00','G','ROSYTH 2012 CA1.4',NULL),(122,'MA_P5','A carton contains 31.5 kg of brown rice. The shopkeeper repacket the brown rice into packets of 350 g each. How many packets of brown rice did he have?','ms','2023-05-29 00:00:00','','ROSYTH 2012 CA1.4',NULL),(123,'MA_P5','How many line(s) of symmetry does this figure have ?','ms','2023-05-29 00:00:00','G','ROSYTH 2012 CA1.4',NULL),(124,'MA_P5','Jack have 5 times as many stamps as Hannah. <br>After Jack bought 18 stamps and Hannah bought 42 stamps, they would have the same number of stamps. <br> How many stamp did Jack have in the end ?','ms','2023-05-29 00:00:00','','ROSYTH 2012 CA1.4',NULL),(125,'MA_P5','Six relatives of Susan were arriving from Thailand this afternoon. <br>The distance between the airport and her house is 23 km. Using the table below, find the taxi fare from the airport to Susanâ€™s house.<br><table><tr><th>Cost for distance travelled</th><th>Taxi fare</th></tr><tr><td>1st km or part there of</td><td>$5.50</td><tr><tr><td>Every additional 400m or part thereof</td><td>$0.34</td></tr><table>','ms','2023-05-29 00:00:00','','ROSYTH 2012 CA1.4',NULL),(126,'MA_P5','In a Science test, John scored thrice as many marks as Ahmad. If Raju has 10 more marks, he would have scored the same marks as John. The total marks of the three boys have scored were 214. <br>How many marks did Raju and Ahmad score together ?','ms','2023-05-29 00:00:00','','ROSYTH 2012 CA1.4',NULL),(127,'MA_P5','Joseph and Boston had some stickers. Joseph gave Boston 5 stickers and he now has twice as many stickers as Boston.<br>If both of them have 138 stickers altogether, how many more stickers did Joseph have than Boston at first ?','ms','2023-05-29 00:00:00','','ROSYTH 2012 CA1.4',NULL),(128,'MA_P5','25 students were picked to welcome guests in a school event. The teacher-in-charge told the students to station themselves in a row at an equal distance of 2 m apart. On the day of the event, some students did not turn up. The students were then told to increase the distance to 3 m apart. <br>How many students did not turn up ?','ms','2023-05-29 00:00:00','','ROSYTH 2012 CA1.4',NULL),(129,'MA_P5','Joanne paid a total of $52 for 2 similar bowls and 4 similar plates. Five bowls cost as much as three plates. <br>How much money would Joanne save if she bought two bowls and two plates instead ?','ms','2023-05-29 00:00:00','','ROSYTH 2012 CA1.4',NULL),(133,'MA_P5','The area of a square is 64 cm<sup>2</sup>. What is the perimeter?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(134,'MA_P5','<math><mfrac><msup>1</msup><msup>5</msup></mfrac></math> of a certain number is 40. What is <math><mfrac><msup>1</msup><msup>4</msup></mfrac></math> of the number?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(135,'MA_P5','Study the number line below. Find the difference between value X and value Y.','ms','2023-05-30 00:00:00','G','NANHUA 2012 CA1.4',NULL),(136,'MA_P5','The length of a rectangular garden is thrice its breadth. 16 pupils are spaced out equally along the length of the garden such that there is a pupil standing at each end. If the distance from one pupil to the next pupil is 60 cm. Find the breadth of the garden.','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(137,'MA_P5','The figure below is made up of a square and a trigangle. The triangle has 3 equal sides. What the perimeter of the figure?','ms','2023-05-30 00:00:00','G','NANHUA 2012 CA1.4',NULL),(138,'MA_P5','Jack wants to buy a bicycle but is short of $44. Jill wants to buy the same bicycle but is short of $37. If they combine the money, they will have just enough money to buy the bicycle. What the cost of 2 such bicycles ?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(139,'MA_P5','I think of a number which is less than 50. When the number is divided by 7, the remainder is 1. When the number is divided by 12, the remainder is 7. What is the number ?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(140,'MA_P5','5 kg of sugar and 6 kg of rice cost $84.50. 1 kg of sugar and 3 kg of rice cost $38.50. How much is 1 kg of sugar ?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(141,'MA_P5','A ferry can carry either 15 lorries or 35 cars. If there are already 9 lorries on the ferry, how many more cars can the ferry carry ?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(142,'MA_P5','There are 135 pens in a box. <math><mfrac><msup>2</msup><msup>3</msup></mfrac></math> of them are red. <math><mfrac><msup>2</msup><msup>9</msup></mfrac></math> of them are green. The rest of the pens are blue. How many more red than blue pens are there ?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(143,'MA_P5','There are some chickens and cows in a farm. In all, there are 20 heads and 56 legs. How many chickens are there ?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(144,'MA_P5','Mr Lee was paid $3 for every bracelet sold. For every 8 bracelets sold, she was given a bonus of $5. How much did she receive if she sold 138 bracelets ?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(145,'MA_P5','James had $40 more than Ken. After James gave Ken $60, Ken had twice as much as James. How much money did James have at first ?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(146,'MA_P5','Mrs Tan is 32 years old. Her son is 5 years old. In how many yearsâ€™ time will she be 4 times as old as her son ?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(147,'MA_P5','Tom and Harry had an equal amount of money at first. Every day, Tom spent $25 and Harry spent $18. When Tom had spent all his money, Harry still had $490 left. How much did each of them have at first ?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(148,'MA_P5','A total of 360 teachers and pupils participated in tree planting. Each teacher planted 3 trees and each group of 3 pupils planted 2 trees. If 520 trees were planted, how many pupils were there ?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(149,'MA_P5','Mr Loh bought some caculators and watches for $752. Each watch cost $24 and each caculator cost $16. He bought 8 more watches than caculators. How many caculators did he buy ?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(150,'MA_P5','Mrs Gopal had 132 hens.She sold <math><mfrac><msup>3</msup><msup>4</msup></mfrac></math> of the hens and <math><mfrac><msup>1</msup><msup>3</msup></mfrac></math> of the ducks. She had a total of 81 hens and ducks left. <br>(a) How many hens had she left ? <br>(b) How many ducks did she sell ?','ms','2023-05-30 00:00:00','','NANHUA 2012 CA1.4',NULL),(151,'MA_P5','Find the value of <math><mfrac><msup>5</msup><msup>6</msup></mfrac></math> + <math><mfrac><msup>5</msup><msup>12</msup></mfrac></math>. Express your answer as a mixed number.','ms','2023-05-30 00:00:00','','NANYANG 2012 CA1.4','5.1.2.2'),(152,'MA_P5','The capacity of a container that was fully filled with water was 4 <em>l</em>. After Aishah poured out some water from the container, the amount of water left was <math><mfrac><msup>3</msup><msup>8</msup></mfrac></math> of the capacity of the container. How many litres of water were left the container ?','ms','2023-05-31 00:00:00','','NANYANG 2012 CA1.4','5.1.2.2'),(153,'MA_P5','What is the missing number in the box ?','ms','2023-05-31 00:00:00','G','NANYANG 2012 CA1.4','5.1.2.1'),(154,'MA_P5','The figure below is not drawn to scale. <br>ABCD is a rectangle and WXYZ is square. WXC is a straight line. Give that  &ang;ZYC is 1<math><mfrac><msup>1</msup><msup>2</msup></mfrac></math> times that of  &ang;ZYX, and  &ang;XYC is equal to  &ang;XCY, find the sum of  &ang;ZYC and  &ang;XCY.','ms','2023-05-31 00:00:00','G','NANYANG 2012 CA1.4','5.2.2.1'),(155,'MA_P5','Mr Widjaya bought 4 identical plots of land each trianglar in shape as shown below. Find the total area of land he had bought.','ms','2023-05-31 00:00:00','G','NANYANG 2012 CA1.4','5.2.2.2'),(156,'MA_P5','In a stationery shop, ball point pens are sold in packets of 3. Each packet costs $1.90.<br>(a) How much must Suri pay if she wants to buy 2 dozens of the ball point pens?<br>(b) What is the maximum number of ball point pens Suri can buy if she has $12 ?','ms','2023-05-31 00:00:00','','NANYANG 2012 CA1.4','5.1.3.1'),(157,'MA_P5','Chee Hoon has 4 times as many stickers as Michael. How many stickers must Chee Hoon give Michael so that each of them will have 115 stickers ?','ms','2023-05-31 00:00:00','','NANYANG 2012 CA1.4','5.1.1.2'),(158,'MA_P5','Jim has some stamps. After giving away 20 stamps to his brother and <math><mfrac><msup>1</msup><msup>4</msup></mfrac></math> of the remaining stamps to his neighbour, Jim found that he had 27 stamps left. How many stamps did Jim have at first ?','ms','2023-05-31 00:00:00','','NANYANG 2012 CA1.4','5.1.2.1'),(159,'MA_P5','The figure below which is not drawn to scale, is made of up of three squares, A, B and C. The three squares meet to form the triangle PQR. Squares A and C have areas of 36 cm<sup>2</sup> and 64 cm<sup>2</sup>  respectively. Given that the perimeter of triangle PQR is 24 cm, find the area of square B.','ms','2023-05-31 00:00:00','G','NANYANG 2012 CA1.4','5.2.2.1'),(160,'MA_P5','Jordan has three times as many blue marbles as red ones and twice as many red ones as green ones. There are 120 marbles that are either white or green. If there are 54 white marbles, how many marbles does Jordan have altogether ?','ms','2023-05-31 00:00:00','','NANYANG 2012 CA1.4','5.1.5.1'),(161,'MA_P5','Haresh is now three times as old as his brother. 7 years ago, the sum of their ages was 30. How old did Haresh be 3 years later ?','ms','2023-05-31 00:00:00','','NANYANG 2012 CA1.4','5.1.5.1'),(162,'MA_P5','Mrs Rosnah needed to buy some items to set up her enrichment centre. She could buy 4 tables and 6 standing fans with $504. With the same amount of money, she could buy 14 standing fans.<br>(a) How many sets of 4 tables and 6 standing fans could she buy with $3000 ?<br>(b) If Mrs Rosnah decided to buy standing fans only, how many standing fans could she buy with $1656 ?','ms','2023-05-31 00:00:00','','NANYANG 2012 CA1.4','5.1.5.1'),(163,'MA_P5','Adele had $120. She paid $42 for 3 books and 2 toys during a sale. She bought another 4 toys and a few more books with all the remaining money. If each book cost $6, how many books did she buy in all ?','ms','2023-05-31 00:00:00','','NANYANG 2012 CA1.4','5.1.5.1'),(164,'MA_P5','Cartons Y and Z contained some apples. If 20 apples were transferred from Carton Y to Carton Z, both cartons would have the same number of apples. If 13 apples were transferred from Carton Z to Carton Y, Canton Y would have 4 times as many apples as Carton Z. How many apples were there in Carton Y at first ? ','ms','2023-05-31 00:00:00','','NANYANG 2012 CA1.4','5.1.5.1'),(165,'MA_P5','The figure below which is not drawn to scale, is made up of eight identical rectangles which are arranged to form square ABCD. Given that  the sum of the perimeters of all the eight rectanlges is 4752 cm, find <br>(a) the length of square ABCD and<br>(b) the area of square ABCD.','ms','2023-05-31 00:00:00','G','NANYANG 2012 CA1.4','5.2.2.3'),(166,'MA_P5','There were 588 children in an exhibition in the morning. After 219 girls left and 86 boys entered the exhibition in the afternoon, <math><mfrac><msup>2</msup><msup>3</msup></mfrac></math> of the total number of girls was then equal to <math><mfrac><msup>1</msup><msup>2</msup></mfrac></math> of the total number of boys. How many girls were there at the exhibition at first ?','ms','2023-05-31 00:00:00','','NANYANG 2012 CA1.4','5.1.5.1'),(167,'MA_P5','A florist had the same number of roses, camations and tulips in her shop at first. In the afternoon, 58 roses, some camations and tulips were sold. There were thrice as many camations as tulips left and the number of roses left was 25 fewer than the number of camations left. There were 108 flowers left in the shop. How many camations were there at first ?','ms','2023-05-31 00:00:00','','NANYANG 2012 CA1.4','5.1.5.1'),(168,'MA_P5','Jane bought some slices of cheesecakes and mango cakes for a party. She spent $60 and $40 on the cheesecakes and mango cakes respectively. Each slice of mango cake cost $2 more than each slice of cheesecake and she bought twice as many cheesecakes as mango cakes. Find the cost of each slice of cheesecake.','ms','2023-05-31 00:00:00','','NANYANG 2012 CA1.4','5.1.5.1');
